import React, { useState, useEffect } from "react";
import bestPitches from "./bestPitches.csv";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  TableSortLabel,
  TextField,
} from "@mui/material";
import { makeStyles } from "@mui/styles";

// set the dimensions of the table
const useStyles = makeStyles({
  table: {
    minWidth: 500,
  },
  tableContainer: {
    maxHeight: 600,
  },
});

// sort the data according to the fields
const sortData = (data, orderBy, order) => {
  const sortedData = [...data];

  // sort in ascending order
  sortedData.sort((a, b) => {
    let result;
    if (order === "asc") {
      if (a[orderBy] < b[orderBy]) {
        result = -1;
      } else {
        result = 1;
      }
    } else {
      if (a[orderBy] > b[orderBy]) {
        result = -1;
      } else {
        result = 1;
      }
    }
    return result;
  });
  return sortedData;
};


export const Results = () => {
  const classes = useStyles();
  const [playerData, setPlayerData] = useState([]);
  const [searchTerm, setSearchTerm] = useState("");
  const [order, setOrder] = useState("asc");
  const [orderBy, setOrderBy] = useState("player_name");

  // continuoslyu update the table with the csv
  useEffect(() => {
    const fetchData = async () => {
      // gett the data from csv and conver to array
      const response = await fetch(bestPitches);
      const data = await response.text();
      let parsedData = data.split("\n").map((row) => row.split(","));
      while (parsedData.length > 0 && parsedData[parsedData.length - 1].every((cell) => !cell)) {
        parsedData.pop();
      }
      // extract headers and set them as keys
      const headers = parsedData.shift();
      const players = parsedData.map((row) =>
        headers.reduce((obj, header, index) => {
          obj[header] = row[index];
          return obj;
        }, {})
      );

      // update the state upon chagne
      setPlayerData(players);
    };
    fetchData();
  }, []);

  // sort according to key
  const createSortHandler = (property) => (event) => {
    const isAsc = orderBy === property && order === "asc";
    setOrder(isAsc ? "desc" : "asc");
    setOrderBy(property);
  };

  // filter according to player name through the search box
  const filteredData = playerData.filter((player) =>
    player.player_name.toLowerCase().includes(searchTerm.toLowerCase())
  );

  const sortedData = sortData(filteredData, orderBy, order);

  return (
    <div>

      <div style ={{textAlign: 'left', paddingLeft: '150px', marginTop: '-140px'}}>
        jlj
      </div>
      <TextField
        label="Search Player"
        value={searchTerm}
        onChange={(e) => setSearchTerm(e.target.value)}
      />
      <TableContainer component={Paper} className={classes.tableContainer}>
        <Table className={classes.table} stickyHeader>
          <TableHead>
            <TableRow>
              <TableCell>
                <TableSortLabel
                  active={orderBy === "player_name"}
                  direction={order}
                  onClick={createSortHandler("player_name")}
                >
                  Player Name
                </TableSortLabel>
              </TableCell>
              <TableCell>
                <TableSortLabel
                  active={orderBy === "pitch_type"}
                  direction={order}
                  onClick={createSortHandler("pitch_type")}
                >
                  Pitch Type
                </TableSortLabel>
              </TableCell>
              <TableCell>
                <TableSortLabel
                  active={orderBy === "stuffGrade"}
                  direction={order}
                  onClick={createSortHandler("stuffGrade")}
                >
                  Stuff Grade
                </TableSortLabel>
              </TableCell>
              <TableCell>
                <TableSortLabel
                  active={orderBy === "nPitches"}
                  direction={order}
                  onClick={createSortHandler("nPitches")}
                >
                  Number of Pitches
                </TableSortLabel>
              </TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {sortedData.map((row, index) => (
              <TableRow key={index}>
                <TableCell>{row.player_name}</TableCell>
                <TableCell>{row.pitch_type}</TableCell>
                <TableCell>{row.stuffGrade}</TableCell>
                <TableCell>{row.nPitches}</TableCell>
              </TableRow>
            ))}
          </TableBody>
        </Table>
      </TableContainer>
    </div>
  );
};



// Creating Pitch Grades
// The immediate output of our model is runs, which while useful, is not something that people within baseball would ultimately be able to easily quantify how valuable one pitch is relative to another. To solve this problem, we converted our predictions onto the 20-80 scale, which is a standard baseball scale that is also a normal distribution with mean 50 and standard deviation of 10. With this grading system, people in baseball are immediately able to say that a 55 grade pitch is better than a 45 grade pitch, as it is higher on the 20-80 scale.

// Our initial attempt at converting the runs to the 20-80 scale failed however, as our model decided that certain pitch types tend to do better at reducing the number of runs scored, which led to our grades being primarily breaking balls as the best graded pitches, with off speed pitches being the worst graded pitches. Our solution to this problem was to grade each pitch relative to the pitch group that it fell into, as this would allow for us to know whether or not someone’s fastball was better than the league average fastball. By doing this, we created a unique grading scale for fastballs, breaking balls, and off speed pitches. 


// Player Evaluation
// The main focus of our project was to create a tool for players and coaches to be able to utilize to improve their own performance. Once we created the pitch grades, we were able to create visualizations unique to each pitcher and their pitches to give them a sense of what they might potentially change in order to improve. We were also able to create summary tables showing off who has the highest graded pitches, which could also provide front offices the ability to identify players that are undervalued by the league and acquire them for cheaper than their true value.
